import React from "react";
import { Link } from "react-router-dom";
import "./Resume.css";


function Resume() {
    return (
        <div className="card">
            <div className="card-content">
                <Link to="./images/resume.pdf" target="_blank" download>Download</Link>
            </div>
        </div>
    )
}

export default Resume;
